import useDarkMode from 'use-dark-mode';
import styled from 'styled-components';
const TopNavbar = () => {
  const darkMode = useDarkMode(false);
  return (
    <div>
    <div className="floating" onClick={darkMode.toggle}>
    </div>
    <style jsx>
      {
        `
        .floating{
        right: 30px;
        position: fixed;
        width: 100px;
        background: #23232E;
        height: 20px;
        padding: 20px;
        margin: auto;
        margin-top: 10px;
        box-shadow: 0 3px 6px rgba(0,0,0,0.16), 0 3px 6px rgba(0,0,0,0.23); 
        transition: all 0.3s; 
        border-radius: 3px;
        }
        .floating.dark-mode{
          background: #23232E;
        }
        .floating.light-mode{
          background: #FFF;
        }
        `
      }
    </style>
    </div>
  );
};

export default TopNavbar;
